import React, { useState, useEffect } from "react";
import axios from "axios";
import { useHistory, Link } from "react-router-dom";
import Button from "@material-ui/core/Button";
const Datatab = () => {
  const history = useHistory();
  const [users, setUser] = useState([]);

  useEffect(() => {
    loadUsers();
  }, []);

  

  const loadUsers = async () => {
    const result = await axios.get(
      `http://localhost:62499/api/zplist/2021-08-02&2021-08-04`
    );
    setUser(result.data);
  };
  return (
    <div className="home-page">
      <table className="table">
        <thead className="thead-dark">
          <tr>
            <th scope="col">#</th>
            <th scope="col">id</th>
            <th scope="col">UserOperationID_21_Col</th>
            <th scope="col">UserOperationID_22_Col</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user, index) => (
            <tr>
              <th scope="row">{index + 1}</th>
              <td>{user.id}</td>
              <td>{user.UserOperationID_21_Col}</td>
              <td>{user.UserOperationID_22_Col}</td>
              
              <Button
                variant="contained"
                color="primary"
                onClick={() => history.push(`/edituser/${user.id}`)}
              >
                Edit
              </Button>
              
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Datatab;
